define(function(require,exports,module){"use strict";var keys=require("../../lib/keys");module.exports.getEditorKeybordShortcuts=function(editor){var KEY_MODS=keys.KEY_MODS;var keybindings=[];var commandMap={};editor.keyBinding.$handlers.forEach(function(handler){var ckb=handler.commandKeyBinding;for(var i in ckb){var modifier=parseInt(i);if(modifier==-1){modifier=""}else if(isNaN(modifier)){modifier=i}else{modifier=""+(modifier&KEY_MODS.command?"Cmd-":"")+(modifier&KEY_MODS.ctrl?"Ctrl-":"")+(modifier&KEY_MODS.alt?"Alt-":"")+(modifier&KEY_MODS.shift?"Shift-":"")}for(var key in ckb[i]){var command=ckb[i][key];if(typeof command!="string")command=command.name;if(commandMap[command]){commandMap[command].key+="|"+modifier+key}else{commandMap[command]={key:modifier+key,command:command};keybindings.push(commandMap[command])}}}});return keybindings}});